values:
M aybe i'm too demanding...if some poor, unfortunate guy ever ends up liking me and i like him back, i think i would be such a demanding, time consuming and jealous&nbsp;girlfriend. I would be the worst girlfriend, actually. If i ever have a boyfriend, i would always want him there...to be there for me, to tell me he loves me, to talk to, to hug...i would be jealous whenever he talked to another girl, i would be depressed if he's not online or busy, i would be sad if he doesn't call or txt me...When i love a guy, i think i could give up everything for him. Just to talk to him, i could skip eating, lose sleep, let my marks slip, wait on the computer for hours...i can't find a balance when i like someone. there's no school, no music, no friends, no family...i hate that. If he's there, i could live just like that. Maybe it's the hormones talking. i just wish a guy didn't have that ability to completely take over my thoughts, feelings and actions. A nice guy could completely take over my mind and my life would mold and fit to his schedule. Am i mentally ill? Do i take my feelings too seriously? Do those small, insignificant feelings somehow enlargen in my mind and i think too much about them?


Why was i such a retard when i was a kid? i wrote an entry years before about how Barnabas liked Tani and i was upset...and i wrote an entry on how i was feeling then wrote "PLZ Tani don't feel guilty" or something to that effect...OBVIOUSLY she would feel bad after reading my post but i didn't think about how she would feel. Why am i so uncaring and selfish?&nbsp;

I don't think i know how to love. i don't know how to love a person...i just know how to be infatuated with a guy...

isn't it that whatever you think of last before you fall asleep, you dream about? or something like that...cuz like if&nbsp;you're stressed about a test you would dream about it cuz it's always on your mind even before you fall asleep. i can't even remember when, but it was recently, i had a dream about you. it's vaguely in my mind now, but it was&nbsp;something like school was cancelled and i wanted to meet up with you so i arranged to meet, but&nbsp;i didn't know the bus routes and it was really confusing...haha, i don't remember it at all, but i clearly remember you being in it. Lately i think about you a lot. Nothing else to occupy my mind i guess.&nbsp;&nbsp;&nbsp;



Kayy, well i wrote that a while ago lol. i still think about him 24/7 and i can't get him out of my mind. i can't focus on piano cuz i'm thinking of him. i'm on the computer so much, just to see when he'll come online. idkkkkkk, i just...but...frig. When he doesn't come visit me, i get so depressed and it's all i think about. i don't want to be like this. I don't want this feeling all the time when he doesn't talk to me on msn or doesn't visit me at school or doesn't txt me to see how i'm doing. Being so...vulnerable? makes me...lose myself. No, i can't blame him for my lack of focus on schoolwork or these feelings that i have...that's myself. He...he just confuses me. i don't like not knowing how the other person feels -- especially him.&nbsp;

Be strong! Aja aja fighting! Don't mind him. He has a gf and he's probably just having doubts about their relationship and then i came along and messed him up. It's no big deal. We just stay friends who are attracted [at least i am.....] to each other and nothing more. Nothing can work out from us anyways...so might as well have that mind-set now before it's too late. Before i like him so much that i dig myself into a hole. What's gonna happen is that he's gonna continue with his gf...get married? And i'll move on. It's not like he's perfect and i can't live without him. I'll just keep looking for a nice, asian, christian guy who really likes me and not in another relationship. Yah. I'll just forget about him and keep going...might as well.

&nbsp;i don't get it. you would think at least my parents would be glad that i'm not gossiping or spreading stuff. Even with them, i thought that they might be a little proud of my values and how i'm not like other girls&nbsp;who talk about everybody else's business without caring who they hurt. Now, because i'm not telling them stuff about somebody else's family, that really has nothing to do with them, 

they say "you don't talk to us about personal stuff"...i've wanted to talk to them about Ryan for weeks. i really want their opinion and what i should do, even though i know they'd probably lecture [or in their words, 'advise'....] me about how i shouldn't feel a certain why and how i shouldn't think about it. if they stopped for a minute to think about how i feel and what i want when i tell them stuff. i want advice...i don't want them to judge me.&nbsp;

someday, i think i'm just going to move out...before i'm 18.

&amp;i feel the need to write here again.
-sigh- my mind changes so much over just 2 months &amp; a few days...i'm so inconsistent. So unsure of what i want. And when i have what i want...i am incapable of keeping it.

So it ends up that i actually started dating the guy who made me miss him so much and made me have the worst&amp;best feeling. April 9, 2007. Exactly a week after i posted last. He was so cute about it too =] i swear, i was smiling the whole week =D one of those cheesy, wide, blushing smilies.&nbsp;
But for some reason, even though i liked him a lot, sometimes i couldn't really put up with him. He was such a nice guy and he would walk me home. But some things were off about it. Like whenever we hugged it was awkward and seemed kind of...unreal? i don't know. &amp;other times i couldn't put up with how immature he acted. Yea, i was immature at times and it was so fun joking around with him and chat with him for hours while neglecting my homework, haha! But at other times...i couldn't keep up with his happyness all the time. I can't be happy all the time. I have such mood swings and periods of time when i get really depressed about nothing. And it was like we didn't...fit.&nbsp;
One time though, while in Syracus shopping in an outlet mall, i could suddenly see us shopping together for...whatever. Like kitchen supplies, clothing, furniture. I could imagine myself smiling my whole life if i was with him. and it felt SO GOOD. Like my future was somehow more clearer and i didn't have to worry about it. I don't know what changed. After 3 weeks and a few days, i broke up with him. I said i wasn't ready - i really wasn't. I said i needed to establish better relationships with my family and with God - i did and i do. I said that i would regret it for the rest of my life - i will. But i didn't tell him that i just...couldn't keep up with him all the time. I'm not smart, I'm not always happy, I can't joke around and have fun.&nbsp;

&amp;now.
Now.
I am still a wreck. For a completely different reason. A completely different guy.
In one month he has made me the most impatient, jealous, cautious, confused, and angry. But he has also made me the most happy, confident, beautiful girl.&nbsp;
I never thought that i would actually like him. It was a shallow thing at first; very shallow. "hey that guy's hot" "yea, he is ^.^" Basically the first thing i said about him and after. He had the most adorable smile - and i suppose he still does. I met him at a coffeehouse and after, he said "hi" to me in the halls, but I approached him first, wanting to know the singer of a chinese song i liked but that my cousin had put on my iPod. After, i would randomly find excuses to talk to him. I asked about lyrics of a chinese song, what a chinese phrase meant. I asked if he was from HK and we talked about it - how beautiful but also how polluted it is. It felt so good to be talking half English and half Chinese to him. So one day, i asked if he was going to 30hr Famine since he went to the church that was also participating in it with my church. He said no, but wanted to know more about it. That's how i got his e-mail. So i sent him information about it and waited. I asked him the next day when i didn't get a reply and he said he hadn't checked his e-mail yet. i guess i was impatient? He said he'd think about it, but then days later, said he couldn't make it because he was volunteering somewhere else on that day. My other friend actually saw him there because she happened to be volunteering at the same place. We talked on MSN, but not really about anything. Then he asked "Are you going out with someone?" What a weird question. Who asks that unless they're interested? and he couldn't possibly be interested. So i said no. Naturally i asked him the same question. When someone asks you something about yourself, you would generally reply with "and you?" So i did. He said yes. I told him he should tell his girlfriend that she was so lucky and he asked why. Why? "Cuz i think you're really cute and i think i like you?!" No. So i said that it was because he was such a nice guy and had the cutest smile - both of which were completely true. Days later he asks if i like a guy and whether he goes to out school. Odd. Who asks that?? everytime it's "guess who i like" with a guy, i end up telling them who i like. And it's usually the guy who's asking. So i ended up telling him because i'm that pathetic. Guess what. Ends up he likes me too. But he has a girlfriend?! I was just too happy to think about it though. The guy that i thought was the cutest guy in my school...liked me. What?! So he called me, i think it was the next night. We talked for...3hr 10mins 40secs...according to him =] But within that...3 hr 10 mins 40 secs, i learned something about him. Something i hoped wasn't true and didn't want to know but was true and i needed to know. Being in gr.12, naturally one would assume the age would be 17 or 18 if they have an early birthday. Not even close. I liked (like?) a guy who is 22...6 years older than me. He told me his story so i understood how he got to the point in being 22 and still in high school. But to like someone who's legally years over being an adult?? What was i thinking? To be fair to myself, he does not look 22. He could easily pass for 18. I couldn't think of him as anything about 18 when i first saw him and after. But this was shocking. Being stereotypical, i had always thought that teenage girls who like their teacher (he could basically be my teacher at that age) were girls who just threw themselves at guy and or older men. They weren't normal. They weren't me. Till now.&nbsp;

-sigh- i have an exam tmrw, so i suppose i should be sleeping now. I'll pour my brains out later.
